    false,nt"url": null,nt"notes": "This narrative report for Quivira National
    Wildlife Refuge outlines Refuge accomplishments from January through April of 1957.
    The report begins by summarizing the weather conditions, water conditions, and food
    and cover during this period. Wildlife- including migratory birds, upland game birds,
    big game animals, furbearers, predators, rodents, raptors, fish, and disease- is
    also covered. The Refuge development and maintenance section discusses physical
    developments and plantings. Resource management is outlined; topics include grazing,
    haying, fur harvesting, and timber removal. The public relations section of the
    report describes recreational uses, Refuge visitors, Refuge participation, hunting,
    fishing, and violations.  Items of interest, photographs, N-R forms, and newspaper
    articles are attached.",nt"license_title": "License Not Specified",nt"extras":
